import './../style/App.css';
import ProfileCard from './ProfileCard';
import HomeNav from './HomeNav';
import Counter from "./Counter";

function App() {
  return (
    <div className="App">
      <>
      <HomeNav />
      <Row>
        <Col>
        <ProfileCard/>
        </Col>
        <Col>
        <Counter />
        </Col>
      </Row>

      </>
    </div>
  );
}

export default App;
